= Qu'est ce qu'un Bookmarklet =

Un Bookmarklet est un lien favoris interactif. Celui de Planète Sankoré permet d'ajouter une référence URL (adresse internet) à la base de connaissance de la communauté tout en qualifiant le lien d'un titre, d'un commentaire, d'une évaluation et même de mots clés.

[[image:bookmarkletex.png]]

= Comment installer le Bookmarklet =

Afin d'utiliser le bookmarklet  il y'a une opération très simple à faire en premier lieu, s’[[inscrire sur le site>>Main.JoinSankore||rel="__blank"]].

Ensuite, glissez l'image suivante dans votre barre de favoris OU effectuez un clic droit sur ce lien {{html}}<a href="javascript:(function(){document.body.appendChild(document.createElement('script')).src='http://sankore.devxwiki.com/xwiki/bin/jsx/Main/AddResources?minify=true';})();" alt="Bookmarklet Sankoré">Bookmarklet Sankoré</a>{{/html}} et ajoutez le à vos favoris.

{{html}}
<a href="javascript:(function(){document.body.appendChild(document.createElement('script')).src='http://sankore.devxwiki.com/xwiki/bin/jsx/Main/AddResources?minify=true';})();"><img src="http://sankore.devxwiki.com/xwiki/bin/download/Sandbox/BookmarkletSetup/bookmarkletadd.png" alt="Bookmarklet Sankoré" /></a>
{{/html}}

= Comment utiliser le Bookmarklet =

Dès que vous trouvez une ressource intéressante sur internet liée à l'initiative Sankoré, cliquez sur le lien "Bookmarklet Sankoré" dans vos favoris. Une interface va alors vous guider pas à pas dans l'ajout du lien à la base de partage Sankoré.

[[image:bookmarkletscreen.png||style="width: 671px; height: 364px;"]]
